	(1, '2023-03-21 21:52:26.513140', '2023-03-26 13:52:19.404384', 'Lập trình viên Python', '-2', 'Tôi đang tìm kiếm một vị trí Python Backend Developer trong một công ty phát triển sản phẩm hoặc dịch vụ công nghệ. Với kinh nghiệm của mình trong phát triển và triển khai các ứng dụng web và dịch vụ trên nền tảng Python, tôi mong muốn được tham gia vào một đội ngũ chuyên nghiệp, sáng tạo và đam mê công nghệ. Mục tiêu của tôi là tham gia vào quá trình phát triển sản phẩm và cải thiện trải nghiệm người dùng thông qua việc áp dụng các công nghệ tiên tiến và đáp ứng các yêu cầu kỹ thuật. Tôi mong muốn đóng góp cho sự phát triển bền vững của công ty và đồng thời phát triển kỹ năng cá nhân của mình.', 3, 2, 2, 2, 1, 0, 'WEBSITE', 37, 1, 1, 2, 15000000, 10000000, NULL, NULL, NULL),
	(2, '2023-03-22 14:34:44.248701', '2023-03-22 14:34:44.248701', NULL, '-3', NULL, NULL, NULL, NULL, NULL, NULL, 0, 'WEBSITE', NULL, NULL, 2, 4, 0, 0, NULL, NULL, NULL),
	(16, '2023-03-25 01:14:31.906327', '2023-03-25 01:14:31.906327', NULL, '-4', NULL, NULL, NULL, NULL, NULL, NULL, 0, 'WEBSITE', NULL, NULL, 3, 5, 0, 0, NULL, NULL, NULL);
INSERT INTO `myjob_job_job_post` (`id`, `create_at`, `update_at`, `job_name`, `slug`, `deadline`, `quantity`, `gender_required`, `job_description`, `job_requirement`, `benefits_enjoyed`, `position`, `type_of_workplace`, `experience`, `academic_level`, `job_type`, `salary_min`, `salary_max`, `is_hot`, `is_urgent`, `contact_person_name`, `contact_person_phone`, `contact_person_email`, `company_id`, `location_id`, `user_id`, `career_id`, `shares`, `views`) VALUES
	(2, '2023-03-28 11:29:49.309601', '2023-03-28 17:24:35.214278', 'Lập Trình Viên Python (Odoo)', 'lap-trinh-vien-python-odoo', '2023-04-28', 10, 'O', '<p>Lập trình viên Python (phần mềm Odoo) sẽ là thành viên của Công ty Battech (Công ty con của Tập đoàn Batgroup) thực hiện các nhiệm vụ sau đây:</p>\n<ul>\n<li>Thiết kế và phát triển ứng dụng ODOO (phát triển và tùy chỉnh module mới).</li>\n<li>Phân tích yêu cầu.</li>\n<li>Sử dụng lại các tính năng có sẵn trong ODOO.</li>\n<li>Tạo mô-đun tùy chỉnh trong ODOO để đáp ứng yêu cầu cụ thể.</li>\n<li>Tham gia vào các dự án phát triển các sản phẩm, dịch vụ.</li>\n<li>Thực hiện lên ý tưởng cho những thay đổi cần thiết trong quá trình phát triển phần mềm để chất lượng sản phẩm chất lượng hơn.</li>\n<li>Phát triển các ứng dụng / tính năng vận hành doanh nghiệp hàng ngày.</li>\n<li>Thực hiện các công việc khác theo yêu cầu của TBP</li>\n</ul>', '<ul>\n<li>Có Kiến thức vững chắc về Python và các khái niệm lập trình.</li>\n<li>Hiểu biết về luồng cơ bản ODOO.</li>\n<li>Có Kiến thức về các mô hình dữ liệu có sẵn trong core ODOO.</li>\n<li>Có kinh nghiệm phát triển các phiên bản mới nhất của ODOO và khả năng xử lý những lỗi xảy ra.</li>\n<li>Có kinh nghiệm cập nhật phiên bản ODOO .</li>\n<li>Có kinh nghiệm OOP, Design Patterns, xây dựng kiến trúc hệ thống</li>\n<li>Có kiến thức cơ bản về thuật toán, cơ sở dữ liệu và giải thuật</li>\n<li>Có Kiến thức cốt lõi về tính năng hiện tại có sẵn trong ODOO - Bán hàng, Mua hàng, CRM, Tài khoản, Hàng tồn kho, Dự án, Time-sheet, HR, v.v.</li>\n<li>Kiến thức về xử lý giao diện người dùng ODOO (XML và Javascript), HTML, CSS, JS, Ajax, jQuery,</li>\n<li>Hiểu biết về quy trình phát triển phần mềm, nắm vững về git</li>\n<li>Có kinh nghiệm OOP, Design Patterns, xây dựng kiến trúc hệ thống</li>\n<li>Có kiến thức tốt về PostgreSQL với khả năng viết các câu truy vấn SQL.</li>\n<li>Xem tùy chỉnh - làm việc trên Widget, Wizards, Java Script, xem XML, v.v.</li>\n<li>Tạo báo cáo Q-Web.</li>\n<li>Nhập dữ liệu bằng nhập ODOO cũng như nhập tùy chỉnh bằng Python.</li>\n<li>Kiến thức về hệ điều hành Linux và Amazon Cloud</li>\n</ul>', '<ul>\n<li>Thu nhập: Thỏa thuận theo kinh nghiệm và năng lực của ứng viên, upto 30 triệu + Hỗ trợ ăn trưa 35k/ngày</li>\n<li>Thưởng các ngày lễ tết, tháng lương 13, thưởng hiệu quả dự án.</li>\n<li>Thời gian làm việc: Từ thứ 2 đến hết thứ 6, hàng ngày từ 08h-17h</li>\n<li>Được hưởng quyền lợi BHXH, BHYT, BHTN đầy đủ theo quy định của nhà nước.</li>\n<li>Được đánh giá xét kết quả công việc, đề bạt lên các vị trí phù hợp với năng lực bản thân</li>\n<li>Chế độ xét duyệt tăng lương định kỳ hàng năm</li>\n<li>Được đào tạo, hướng dẫn, phát triển bản thân nâng cao trình độ chuyên môn, nghiệp vụ, kỹ năng</li>\n<li>Làm việc tại môi trường chuyên nghiệp, năng động, trẻ trung, thân thiện và trải nghiệm các hoạt động văn hóa doanh nghiệp đặc sắc</li>\n<li>Cơ hội tiếp cận với những doanh nghiệp, dự án lớn, những xu hướng công nghệ/nền tảng mới nhất, thỏa sức sáng tạo phát triển bản thân</li>\n<li>Các chế độ phúc lợi theo chính sách của Công ty: Nghỉ phép năm, thưởng các ngày lễ, tết, thăm hỏi, tặng quà, hỗ trợ …</li>\n</ul>', 3, 2, 2, 3, 1, 10000000, 15000000, 0, 1, 'Bùi Khánh Huy', '0888425094', 'khuy220@gmail.com', 1, 5, 3, 37, 0, 0),
	(3, '2023-03-28 11:35:26.156973', '2023-03-28 11:35:26.156973', 'Nhân Viên IT - IT Helpdesk', 'nhan-vien-it-it-helpdesk', '2023-05-30', 5, 'O', '<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">1. Quản trị hệ thống máy tính, hỗ trợ người sử dụng trong công ty hoạt động hiệu quả.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">2. Thiết lập, bảo trì, sửa chữa hệ thống mạng nội bộ của công ty.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">3. Quản lý hệ thống: server, Data center, camera, chấm công.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">4. Quản lý các thiết bị công nghệ thông tin và công nghệ của công ty</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">5. Đề xuất, lập kế hoạch bảo trì, nâng cấp hệ thống, thiết bị định kỳ; thay đổi dịch vụ theo yêu cầu phát triển của công ty.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">6. Hỗ trợ Hành chính quản lý, bảo trì, sửa chữa và thay thế tài sản thiết bị văn phòng.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">7. Thực hiện một số công việc khác theo yêu cầu Trưởng phòng và Ban Giám đốc.</span>&nbsp;</p>', '<h1 style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">1. Học vấn và kinh nghiệm</span></h1>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Tốt nghiệp Cao đẳng, Đại học chuyên ngành CNTT.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Có kinh nghiệm về quản trị mạng, quản trị hệ thống server.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Có kinh nghiệm về phần cứng máy tính.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Có ít nhất 02 năm làm lĩnh vực theo yêu cầu.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Có trách nhiệm với công việc, làm việc nghiêm túc, nhanh nhẹn, nhiệt tình.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Ưu tiên ứng viên có nhiều kinh nghiệm quản lý website</span></p>\n<p><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;"><strong>2. Kỹ năng cá nhân</strong></span><strong> </strong></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Kỹ năng giao tiếp, truyền đạt thông tin tốt.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Tự tin, tích cực và chủ động trong công việc.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Sáng tạo và độc lập trong công tác chuyên môn</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Thành thạo tiếng Anh là một lợi thế.</span>&nbsp;</p>', '<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Thu nhập: Lương (cạnh tranh) + Hoa hồng theo KPI dự án</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Bảo hiểm Xã hội</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Du lịch 01 năm/lần</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">- Môi trường làm việc trẻ, năng động, hòa đồng và có cơ hội phát triển sự nghiệp</span>&nbsp;</p>', 3, 2, 4, 2, 1, 12000000, 15000000, 0, 0, 'Bùi Khánh Huy', '0888425094', 'khuy220@gmail.com', 1, 6, 3, 37, 0, 0),
	(4, '2023-03-28 18:42:03.899084', '2023-03-28 18:42:03.899084', 'Kỹ Sư Điện Tử Viễn Thông Không Yêu Cầu Kinh Nghiệm (Đi Làm Ngay)', 'ky-su-ien-tu-vien-thong-khong-yeu-cau-kinh-nghiem', '2023-04-07', 5, 'O', '<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Khảo sát, Thiết kế, lập dự án mạng ngoại vi, hệ thống thiết bị viễn thông, truyền hình cho VNPT, VTV, VOV, nhà mạng Vinaphone, viettel, mobilefone.... </span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Thiết kế mạng ngoại vi viễn thông (Lập bản vẽ thiết kế bằng phần mềm Autocad);</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Lập dự toán, dự án các công trình xây dựng, viễn thông, phát thanh truyền hình </span>&nbsp;</p>', '<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Tốt nghiệp từ Cao đẳng, Đại học chuyên ngành kỹ sư điện tử viễn thông</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Sử dụng thành thạo các phần mềm Word, Excel, Autocad (Biết sử dụng các phần mềm lập dự toán như G8, F1 là một lợi thế)</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Chấp nhận sinh viên mới ra trường, hoặc kinh nghiệm trên 1 năm</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Ưu tiên người có kinh nghiệm trong thiết kế kết mạng ngoại vi và lập dự án các công trình viễn thông, phát thanh truyền hình.</span>&nbsp;</p>', '<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Mức lương: 7 -12 Triệu ( Tùy theo năng lực của ứng viên)</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Được hưởng mức lương cạnh tranh xứng đáng với năng lực và chế độ đãi ngộ đặc biệt theo chức danh đảm nhiệm;</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Được hưởng đầy đủ chế độ BHXH, BHYT, BHTN và chế độ thưởng, ngày nghỉ theo luật lao động hiện hành và quy định của Công ty.. </span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Chưa có kinh nghiệm sẽ được đào tạo.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Chế độ tăng lương hàng năm;</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Môi trường làm việc chuyên nghiệp năng động, hòa đồng</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Cam kết công việc ổn định, gắn bó lâu dài với công ty</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Có nhiều cơ hội thăng tiến trong công việc</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">+ Cụ thể sẽ được trao đổi thêm trong quá trình phỏng vấn</span>&nbsp;</p>', 3, 2, 1, 3, 1, 7000000, 12000000, 0, 1, 'Bùi Khánh Huy', '0888425094', 'khuy220@gmail.com', 1, 7, 3, 36, 0, 0),
	(5, '2023-03-29 01:24:06.491983', '2023-03-29 01:24:06.491983', 'Trưởng Nhóm Thu Hồi Nợ Trực Tiếp', 'truong-nhom-thu-hoi-no-truc-tiep', '2023-05-15', 10, 'O', '<ul>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Quản lý, triển khai và giám sát công tác thu hồi các khoản nợ của Nhóm/ Bộ phận được giao phụ trách</span></li>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Hỗ trợ visit khách hàng với Field và các công việc khác trong quá trình thu hồi nợ; Đánh giá visit của các Field; tổ chức, tham gia đào tạo huấn luyện CBNV.</span></li>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Chủ động tham gia đóng góp ý kiến về quy trình, phần mềm .. liên quan đến công tác thu hồi nợ; cập nhật thường xuyên các vấn đề mới liên quan đến việc đôn đốc thu hồi nợ nhằm cải tiến quy trình giúp thu hồi nợ hiệu quả hơn.</span></li>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Lập báo cáo định kỳ và đột xuất theo yêu cầu của trưởng phòng/cấp có thẩm quyền.</span></li>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Các công việc khác theo yêu cầu của Cấp có thẩm quyền</span>&nbsp;</li>\n</ul>', '<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Bằng cấp và chuyên ngành: Đại học</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Chuyên ngành: Luật/Tài chính Ngân hàng/Kinh tế hoặc lĩnh vực liên quan.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Có kinh nghiệm làm việc từ 3 năm trở lên tại các Ngân hàng/Tổ chức tín dụng nước ngoài hoặc các Ngân hàng có trình độ phát triển tương đương hoặc hơn TPBank.</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Yêu cầu khác: Tin học: Thành thạo sử dụng các phần mềm VP</span></p>\n<ul>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Kỹ năng:</span></li>\n</ul>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Kỹ năng giao tiếp (trực tiếp và bằng văn bản) tốt</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Khả năng thuyết phục trong các tình huống áp lực</span></p>\n<p style="text-align:start;"><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Kỹ năng quản lý thời gian và quản lý đội, nhóm</span>&nbsp;</p>', '<ul>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Mức lương cạnh tranh</span></li>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Môi trường làm việc chuyên nghiệp, năng động</span></li>\n<li><span style="color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 14px;font-family: Lexend, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji;">Cơ hội thăng tiến, đào tạo chuyên sâu</span>&nbsp;</li>\n</ul>', 3, 2, 2, 2, 1, 18000000, 20000000, 0, 1, 'Thu Trang', '0895636598', 'thutrang@gmail.com', 2, 9, 6, 7, 0, 0);
INSERT INTO `myjob_myjob_feedback` (`id`, `create_at`, `update_at`, `content`, `rating`, `is_active`, `user_id`) VALUES
	(1, '2023-03-29 02:32:34.000000', '2023-03-29 02:32:34.000000', 'Tôi rất hài lòng với web MyJob! Tôi nhận được phản hồi từ các NTD rất nhanh. Giao diện mới giúp tôi thực hiện các thao tác dễ dàng hơn và tôi đã nhận được nhiều lời mời phỏng vấn từ các công ty lớn', 5, 1, 2),
	(2, '2023-03-29 02:32:34.000000', '2023-03-29 02:32:34.000000', 'MyJob đã làm rất tốt và tôi chắc chắn giới thiệu app tìm việc này tới bạn bè của tôi. Nhân viên làm việc rất chuyên nghiệp. Tôi được hướng dẫn chi tiết từ A-Z', 5, 1, 4),
	(3, '2023-03-29 02:32:34.000000', '2023-03-29 02:32:34.000000', 'MyJob giúp em tìm thấy công việc phù hợp với mình thông qua các đề xuất được cập nhật qua email mỗi ngày. Em đã tìm thấy nhiều cơ hội thực tập uy tín để xây dựng kinh nghiệm thực tế trong lĩnh vực Marketing mà mình yêu thích', 5, 1, 5);
